//необходимости передавать пропсы на промежуточных уровнях.
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <Context.Provider value={{
    user:new User
  }}>
    <BrowserRouter>
      <AppRouter />
    </BrowserRouter>
    ,
  </Context.Provider>,
);

